import React from "react";
import {ListGroupItem} from "reactstrap";


let CharacterView = (props) =>{
  return (<ListGroupItem onClick={setCharacter.bind(props)}>
    <div>
      <h2>{props.node.name}</h2>
      <p>{props.node.species.name} from {props.node.homeworld.name}</p>
    </div>
    <i className="arrow"/>
  </ListGroupItem>);
};

export default CharacterView;
